import { Table } from 'react-bootstrap';
import axios from 'axios';
import React, { useState, useEffect } from 'react';
export default function Apiclass1() {
    const [data, setData] = useState([]);
    useEffect(() => {
        fetch("http://localhost/codeIgniter/ReactAPI/getAll1", {
            method: 'GET',
            // headers: { 'Accept': 'application/json', 'Content-Type': 'application/json' }
        }).then((result) => {
            result.json().then((res) => {
                // console.log(res);
                setData(res.users);
            })
        })
        // axios({
        //     method: "GET",
        //     url: "http://localhost/codeIgniter/ReactAPI/api/getAll",
        // }).then(function (response) {
        //     //console.log(response);
        //     setData(response.data.users);
        // }).catch(function (response) {
        //     console.log(response);
        // });
    }, [])
    return (
        <div>
            <h2>Api GET Method</h2>
            <Table striped bordered hover className='maptbl' align='center'>
                <thead>
                    <tr>
                        <th>S.N</th>
                        <th>Name</th>
                        <th>Email</th>
                        <th>contact</th>
                        <th>Action</th>
                    </tr>
                </thead>
                <tbody>
                    {
                        data.map((item, index) =>
                            <tr key={index} id={index}>
                                <td>{index + 1}</td>
                                <td>{item.name}</td>
                                <td>{item.email}</td>
                                <td>{item.phone}</td>
                                <td>{item.id}</td>
                            </tr>
                        )
                    }
                </tbody>
            </Table>
        </div>
    )
}
